import React from 'react';
import './componentes.scss';
import tileData from './tileData';

const Productos = () =>{
const Productos = tileData.map((pro, i) => <div key={i} id='producto 2'> <img src="{pro.img}jpg" alt="Girl in a jacket" width="500" height="600"></img>  <br/> {pro.author}</div>)
return(
        <>
        {Productos}
        </>
)
}

export default Productos
